import React from 'react';
import Login from './auth/Login';
import Signup from './auth/Signup';

const HomePage = () => {
  return (
    <main>
      <section id="home">
        <h2>Welcome to My Simple Homepage</h2>
        <p>This is a simple React homepage example.</p>
      </section>
      <section id="about">
        <h2>About</h2>
        <p>This section contains information about the homepage.</p>
      </section>
      <section id="contact">
        <h2>Contact</h2>
        <p>This section contains contact information.</p>
      </section>
      <Login />
      <Signup />
    </main>
  );
};

export default HomePage;
